    data: |
      SELECT + col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT ( - col0 NOT BETWEEN - col2 * + col0 + + col2 * + 64 * + col0 / - col2 AND - col2 );
  - name: tab0

outputs:
  - name: q11351.out
    data: |
      21
